Actionscript.script:
function 击飞炸弹攻击(攻击点)
{
	var 声音 = "";
	var 霰弹值 = 1;
	var 子弹散射度 = 0;
	var 发射效果 = "";
	var 子弹种类 = "子弹-集束炸药";
	var 子弹威力 = _parent.空手攻击力 * 2;
	var 子弹速度 = random(20) + 5;
	var 击中地图效果 = "";
	var Z轴攻击范围 = 25;
	var 击倒率 = 1;
	var 击中后子弹的效果 = "";
	var 子弹敌我属性 = !_parent.是否为敌人;

	var myPoint = {x:攻击点._x, y:攻击点._y};
	//注意这里使用的是再上一级元件计算炸弹飞出点。虽然并不知道为什么但是不敢乱改
	_parent.localToGlobal(myPoint);
	_root.gameworld.globalToLocal(myPoint);
	shootX = myPoint.x;
	shootY = myPoint.y;
	_root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._name,shootX,shootY,_parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

if(_parent.已加经验值 != true)
{
   _parent.击倒呐喊();
}

onClipEvent (load) {
	_parent.击飞炸弹攻击(this);
}

onClipEvent (load) {
	_parent.击飞炸弹攻击(this);
}

onClipEvent (load) {
	_parent.击飞炸弹攻击(this);
}

onClipEvent(load){
   声音 = "glock18-2.wav";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "枪火";
   子弹种类 = "子弹-集束炸药";
   子弹威力 = _parent._parent.空手攻击力;
   子弹速度 = random(20) + 5;
   击中地图效果 = "火花";
   Z轴攻击范围 = 25;
   击倒率 = 1;
   击中后子弹的效果 = "";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent._parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

